package queues;

import java.util.PriorityQueue;

public class PriorityQ {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		PriorityQueue<String> q = new PriorityQueue<>();
		q.add("Sine");
		q.add("Cosine");
		q.add("Tan");
		q.add("Cot");
		q.add("Cosec");
		q.add("Sec");
		System.out.println(q);

	}

}
